// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./PodManager.sol";
import "./Structs.sol";
import "./implementations/PodToken.sol";

/**
 * @title manager for pod withdrawals
 * @author Eric Nordelo
 * @notice manages the withdrawals proposals and the multisign logic
 */
contract PodWithdrawManager is AccessControl {
    using Counters for Counters.Counter;

    Counters.Counter private _withdrawProposalIds;

    bytes32 public constant ADMIN = keccak256("ADMIN");
    uint64 private constant PROPOSAL_DURATION = 1 weeks;

    address public podManagerContractAddress;

    // map from Id to WithdrawProposal
    mapping(uint256 => WithdrawProposal) private _withdrawProposals;
    // stores a mapping of owners and if already voted by proposalId
    mapping(uint256 => mapping(address => bool)) private _withdrawProposalsVoted;
    mapping(address => address[]) private _podsOwners;

    event CreateWithdrawProposal(
        address indexed podAddress,
        address indexed recipient,
        uint256 amount,
        uint256 indexed proposalId
    );
    event ApproveWithdrawProposal(
        address indexed podAddress,
        address indexed recipient,
        uint256 amount,
        uint256 indexed proposalId
    );
    event DenyWithdrawProposal(
        address indexed podAddress,
        address indexed recipient,
        uint256 amount,
        uint256 indexed proposalId
    );
    event VoteWithdrawProposal(address indexed voter, address indexed podAddress, uint256 indexed proposalId);
    event ExpireWithdrawProposal(
        address indexed podAddress,
        address indexed recipient,
        uint256 amount,
        uint256 indexed proposalId
    );

    constructor() {
        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(ADMIN, msg.sender);
    }

    /**
     * @notice sets the addresses to support integration
     * @param _podManagerContractAddress the address of the Privi NFT contract
     */
    function setPodManagerContractAddress(address _podManagerContractAddress) external onlyRole(ADMIN) {
        podManagerContractAddress = _podManagerContractAddress;
    }

    /**
     * @notice save the owners for multisig feature
     * @param _podAddress the address of the pod
     * @param _owners the array of the owners
     */
    function savePodOwners(address _podAddress, address[] memory _owners) external onlyRole(ADMIN) {
        _podsOwners[_podAddress] = _owners;
    }

    /**
     * @notice create a proposal for withdraw funds
     * @param _recipient the recipient of the transfer
     * @param _podAddress the address of the pod
     * @param _amount the amount of the funding token to withdraw
     */
    function createWithdrawProposal(
        address _recipient,
        address _podAddress,
        uint256 _amount
    ) external {
        _withdrawProposalIds.increment();

        uint256 proposalId = _withdrawProposalIds.current();

        int256 index = getOwnerIndex(msg.sender, _podAddress);
        require(index >= 0, "Invalid requester");

        WithdrawProposal memory _withdrawProposal = WithdrawProposal({
            minApprovals: uint64(_podsOwners[_podAddress].length),
            maxDenials: 1,
            positiveVotesCount: 0,
            negativeVotesCount: 0,
            podAddress: _podAddress,
            recipient: _recipient,
            amount: _amount,
            date: uint64(block.timestamp),
            duration: PROPOSAL_DURATION
        });

        // save the proposal for voting
        _withdrawProposals[proposalId] = _withdrawProposal;

        emit CreateWithdrawProposal(_podAddress, _recipient, _amount, proposalId);
    }

    /**
     * @notice allows owners to vote withdraw proposals for pods
     * @param _proposalId the id of the withdraw proposal
     * @param _vote the actual vote: true or false
     */
    function voteWithdrawProposal(uint256 _proposalId, bool _vote) external {
        require(_withdrawProposals[_proposalId].minApprovals != 0, "Unexistent proposal");

        WithdrawProposal memory withdrawProposal = _withdrawProposals[_proposalId];

        int256 index = getOwnerIndex(msg.sender, withdrawProposal.podAddress);
        require(index >= 0, "Invalid owner");

        require(!_withdrawProposalsVoted[_proposalId][msg.sender], "Owner already voted");

        _withdrawProposalsVoted[_proposalId][msg.sender] = true;

        // check if expired
        // solhint-disable-next-line
        if (withdrawProposal.date + withdrawProposal.duration < block.timestamp) {
            // delete the recover gas
            delete _withdrawProposals[_proposalId];
            emit ExpireWithdrawProposal(
                withdrawProposal.podAddress,
                withdrawProposal.recipient,
                withdrawProposal.amount,
                _proposalId
            );
        } else {
            // if the vote is positive
            if (_vote) {
                // if is the last vote to approve
                if (withdrawProposal.positiveVotesCount + 1 == withdrawProposal.minApprovals) {
                    delete _withdrawProposals[_proposalId];

                    PodInfo memory podInfo = PodManager(podManagerContractAddress).getPodInfo(
                        withdrawProposal.podAddress
                    );
                    // make the transfer
                    PodToken(withdrawProposal.podAddress).transferContractBalance(
                        withdrawProposal.recipient,
                        withdrawProposal.amount,
                        podInfo.pod.fundingToken
                    );

                    emit ApproveWithdrawProposal(
                        withdrawProposal.podAddress,
                        withdrawProposal.recipient,
                        withdrawProposal.amount,
                        _proposalId
                    );
                } else {
                    // update the proposal and emit the event
                    _withdrawProposals[_proposalId].positiveVotesCount++;
                    emit VoteWithdrawProposal(msg.sender, withdrawProposal.podAddress, _proposalId);
                }
            }
            // if the vote is negative
            else {
                // if is the last vote to deny
                if (withdrawProposal.negativeVotesCount + 1 == withdrawProposal.maxDenials) {
                    // delete the proposal and emit the event
                    delete _withdrawProposals[_proposalId];
                    emit DenyWithdrawProposal(
                        withdrawProposal.podAddress,
                        withdrawProposal.recipient,
                        withdrawProposal.amount,
                        _proposalId
                    );
                } else {
                    // update the proposal and emit the event
                    _withdrawProposals[_proposalId].negativeVotesCount++;
                    emit VoteWithdrawProposal(msg.sender, withdrawProposal.podAddress, _proposalId);
                }
            }
        }
    }

    /**
     * @notice allows the return of funds after a pod disposal
     */
    function returnPodTokens(address _podAddress) external {
        PodInfo memory podInfo = PodManager(podManagerContractAddress).getPodInfo(_podAddress);
        require(podInfo.pod.fundingDate <= block.timestamp, "Funding date not reached");
        require(podInfo.raisedFunds < podInfo.pod.fundingTarget, "Funding target reached");
        uint256 claimableAmount = PodManager(podManagerContractAddress).podToTokensClaimable(
            _podAddress,
            msg.sender
        );
        uint256 amountToReturn = (claimableAmount * podInfo.pod.fundingTokenPrice) /
            PodManager(podManagerContractAddress).PRECISION();
        PodToken(_podAddress).returnPodTokens(msg.sender, podInfo.pod.fundingToken, amountToReturn);
    }

    /**
     * @notice proposal struct getter
     * @param _proposalId The id of the withdraw proposal
     * @return the WithdrawProposal object
     */
    function getUpdateMediaProposal(uint256 _proposalId) external view returns (WithdrawProposal memory) {
        WithdrawProposal memory withdrawProposal = _withdrawProposals[_proposalId];
        require(withdrawProposal.minApprovals != 0, "Unexistent proposal");
        return withdrawProposal;
    }

    /**
     * @param _owner The address of the owner to look for
     * @param _podAddress The address of the pod
     * @return The index
     */
    function getOwnerIndex(address _owner, address _podAddress) internal view returns (int256) {
        uint256 count = _podsOwners[_podAddress].length;
        for (uint256 i = 0; i < count; i++) {
            if (_podsOwners[_podAddress][i] == _owner) {
                return int256(i);
            }
        }
        return -1;
    }
}

